import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <ClassComponent />
      </div>
    );
  }
}
class ClassComponent extends Component {
  render() {
    return <div className="firstComponent">Class Component</div>;
  }
}

function functionComponent() {
  return <div className="thirdComponent">Function Component</div>;
}
export default App;
